targets.expr:
sum by (strategy_name) (
  label_join(
    ixn_health_info_router_strategy_currently_submitted{
      tenant="$Tenant", router_name=~"$Router", strategy_name=~"$Strategy"
    },
    "strategy_name", " @ ", "strategy_name", "router_name"
  )
)

sum by (strategy_name) (
  label_join(
    ixn_health_info_router_strategy_current_capacity{
      tenant="$Tenant", router_name=~"$Router", strategy_name=~"$Strategy"
    },
    "strategy_name", " @ ", "strategy_name", "router_name"
  )
)

sum by (strategy_name) (
  label_join(
    increase(ixn_health_info_router_strategy_total_submitted{
      tenant="$Tenant", router_name=~"$Router", strategy_name=~"$Strategy"
    }[10m]),
    "strategy_name", " @ ", "strategy_name", "router_name"
  )
)

sum by (strategy_name) (
  label_join(
    increase(ixn_health_info_router_strategy_total_submitted{
      tenant="$Tenant", router_name=~"$Router", strategy_name=~"$Strategy"
    }[24h]),
    "strategy_name", " @ ", "strategy_name", "router_name"
  )
)

sum by (strategy_name) (
  label_join(
    increase(ixn_health_info_router_strategy_total_submitted{
      tenant="$Tenant", router_name=~"$Router", strategy_name=~"$Strategy"
    }[$__range]),
    "strategy_name", " @ ", "strategy_name", "router_name"
  )
)

sum by (strategy_name) (
  label_join(
    ixn_health_info_router_strategy_total_submitted{
      tenant="$Tenant", router_name=~"$Router", strategy_name=~"$Strategy"
    },
    "strategy_name", " @ ", "strategy_name", "router_name"
  )
)
